import React from "react";
import "./Header.css";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import { Link } from "react-router-dom";
import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";
import Avatar from "@material-ui/core/Avatar";

const RecentPhotosLink = React.forwardRef((props, ref) => (
  <Link innerRef={ref} to="/" {...props} />
));

const FavoritesLink = React.forwardRef((props, ref) => (
  <Link innerRef={ref} to="/favs" {...props} />
));

const useStyles = makeStyles(theme => ({
  button: {
    margin: theme.spacing(1)
  },
  input: {
    display: "none"
  }
}));

const Header = () => (
  <div>
    <AppBar position="static" m={12}>
      <Toolbar>
        <Typography variant="title" color="inherit" m={12}>
          FLICKRecentViewer
        </Typography>
        {/* <Grid justify="space-between" display="inline"> */}
        <Box m={1}>
          <Button
            variant="contained"
            className={useStyles.button}
            component={RecentPhotosLink}
            p={1}
            m={12}
          >
            RECENT PHOTOS
          </Button>
        </Box>
        <Box m={1}>
          <Button
            variant="contained"
            className={useStyles.button}
            component={FavoritesLink}
            p={1}
            m={12}
          >
            FAVORITES
          </Button>
        </Box>
        {/* </Grid> */}
        <Avatar
          alt="Remy Sharp"
          src="/static/images/avatar/1.jpg"
          className={classes.avatar}
        />
      </Toolbar>
    </AppBar>
  </div>
);

export default Header;
